import React from "react";
import { Link } from "react-router-dom";

const CreateProjectButton = () => {
  return (
    <Link to="" href="ProjectForm.html" className="btn btn-lg btn-info">
      Create a Project
    </Link>
  );
};

export default CreateProjectButton;
